    LANGUAGE plpgsql
    AS $$
begin
            iF EXISTS (SELECT 1 FROM material m WHERE m.kod_material=OLD.kod_material AND m.nom_skl=OLD.nom_skl AND not(m.count-old.count=0)) THEN
                 UPDATE material SET count=count-OLD.count WHERE kod_material=OLD.kod_material AND nom_skl=OLD.nom_skl;
            ELSE
                 DELETE FROM material WHERE kod_material=OLD.kod_material AND nom_skl=OLD.nom_skl;
